package tcs.ril.storebot.model;import java.util.ArrayList;import java.util.List;public class HelpPagerData {    String Heading;    List<String> bulletPoints;    public HelpPagerData(String heading, List<String> bulletPoints) {        Heading = heading;        this.bulletPoints = bulletPoints;    }    public String getHeading() {        return Heading;    }    public void setHeading(String heading) {        Heading = heading;    }    public List<String> getBulletPoints() {        return bulletPoints;    }    public void setBulletPoints(List<String> bulletPoints) {        this.bulletPoints = bulletPoints;    }}